import { GlobalCss } from "./styles/global";
import { Header } from "./components/Header";
import { MainContent } from "./components/MainContent";

function App() {
  return (
    <>
      <Header />

      <div id="default-content-container">
        <MainContent />
      </div>

      <GlobalCss />
    </>
  );
}

export default App;
